INSERT INTO `medici` VALUES (30,'Adrian Tudor','adrian.tudor@gmail.com','adrian123','Adrian','Tudor','Dr. Adrian Tudor Stan este medic dentist, specialist în parodontologie și doctor în științe medicale. Toate studiile și specializările le-a urmat la Facultatea de Medicină Dentară din cadrul Universității de Medicină și Farmacie „Victor Babeș” din Timișoara, unde, de asemenea, a profesat și din postura de asistent universitar, predând studenților stomatologi din primii trei ani.\n\nPe perioada facultății și a rezidențiatului, Dr. Stan s-a implicat în activități de voluntariat profesional în cadrul organizației studențești Timisoara Dental Students Association din postura de vicepreședinte și Rotaract Timișoara Ripensis, ulterior Rotaract București Triumph. De asemenea, participă în mod constant la numeroase congrese și workshop-uri de specialitate, pentru o continuă perfecționare în domeniul parodontologiei.\n\nA publicat 13 articole de tip ISI, ISI proceedings și numeroase alte articole BDI, rezumate, postere, cu care a participat la congrese de profil din țară și străinătate. Conform Web of Science (Clarivate), are un indice Hirsch 4.','Stomatologie generală, Parodontologie',_binary 'data:image/jpeg;base64,'),(31,'Eduard Margelatu','dasasd','adsad','Eduard','Margelatu','Mi-am început cariera în medicina dentară în anul 2010, ca absolvent al Facultății de Medicină și Farmacie \"UMF Carol Davila” din București.Am văzut posibilități nelimitate în practica limitată la endodonție și restaurări directe/indirecte sub ghidaj microscopic.\n\nDrumul meu continuă cu dorința de a participa la manifestările de elită ale medicinei dentare internaționale, dar și cu dorința de a împărtăși colegilor mei cele învățate în seria de traininguri pe care le susțin ca lider de opinie pentru una din cele mai prestigioase firme din domeniu.\n\nEnergia mea provine din plăcerea de a construi fundația tuturor tratamentelor din cabinetul de medicină dentară, de la cele mai simple restaurări și până la cele mai complexe reabilitări. Nimic nu se compară cu a conserva și a valorifica la maximum țesutul dentar natural și a-i reda frumusețea și rezistența în timp.Sunt bucuros să-mi pot folosi abilitățile aici, în clinica dentară SANADOR, locul în care sănătatea orală este la ea acasă, într-o familie de specialiști implicați cu sufletul în fiecare caz.','Stomatologie generală',_binary 'data:image/jpeg;base64,'),(32,'Laura Calin','dasda','dada','Laura','Calin','De când am absolvit facultatea de Medicină Dentară, am ales stomatologia pediatrică din dorința de a lucra cu cei mici și de a crea adulții fără teamă de stomatolog. Tratez pacienți cu vârste între 1 an și 18 ani, începând cu cazuri de prevenție până la cazuri complexe cu recomandare de coroane dentare pediatrice.\n\nSunt o fire deschisă și comunicativă, răspund necesității părinților de a se informa de la un specialist, încurajându-i permanent ca prima vizită a copilului la medic să fie făcută la apariția primului dinte temporar, nu în momentul unei urgențe. Prevenția este cea mai bună decizie pe care o poate lua un părinte pentru copilul său.\n\nParticip permanent la congrese și cursuri, unele susținute de speakeri internaționali precum Dr. Curtis Goho, Dr. Yohannes Einwag, Dr. Tetyana Peshko, care contribuie la dezvoltarea mea profesională și mă ajută să ofer tratamente la standarde înalte micilor pacienți.','Pedodonție.',_binary 'data:image/jpeg;base64,');
